          padding: "30px",
          textAlign: "center",
          bottom: "0",
          left: "0",
          width: "100%",
          display: "block",
          position: "fixed",
          marginTop: "20px"
        }}
        > 
      &copy; {new Date().getFullYear()} Copyright
      </footer>
    );
  }

  export default Footer
